import React from "react";
import "./Main.css";
import logo from "../../instagram.png";

const Main = () => {
  return (
    <div className="main">
      <nav className="header">
        <div className="logoBox">
          <img className="instagramLogo" src={logo} alt="로고" />
        </div>
        <div className="searchForm"></div><div className="userMenu"></div>
      </nav>
    </div>
  );
};

export default Main;
